INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/01/31 12:00:00", 1, 2, 1, 0.0, -416.5, 3.414, 1000001, 62, 190803, "2030/01/01 14:59:59", 1, "カリン", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/01/31 12:00:00", 1, 2, 2, 0.0, -416.5, 3.099, 1000002, 62, 190803, "2030/01/01 14:59:59", 1, "カリン", "ミッションをクリアして、\n報酬をゲットしましょう！");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/01/31 12:00:00", 1, 2, 3, 0.0, -416.5, 2.801, 1000003, 63, 190803, "2030/01/01 14:59:59", 1, "カリン", "受け取ることができる\n報酬があるようです\n確認してみてください");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/01/31 12:00:00", 2, 2, 4, 0.0, -416.5, 0.0, 1000004, 63, 190803, "2030/01/01 14:59:59", 1, "カリン", "報酬がもらえますよ！\nチェックしてみてください");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/01/31 12:00:00", 2, 1, 5, 0.0, -363.0, 2.12, 1000005, 64, 190803, "2030/01/01 14:59:59", 1, "カリン", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/01/31 12:00:00", 1, 2, 6, 0.0, -363.0, 1.68, 1000006, 64, 190803, "2030/01/01 14:59:59", 1, "カリン", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/01/31 12:00:00", 2, 1, 7, 0.0, -363.0, 2.33, 1000007, 64, 190803, "2030/01/01 14:59:59", 1, "カリン", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/01/31 12:00:00", 3, 7, 101, -6.0, -285.0, 5.18, 1020101, 61, 133701, "2030/01/01 14:59:59", 10201, "ラビリスタ", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/01/31 12:00:00", 1, 2, 201, -2.0, -285.0, 8.77, 1020102, 61, 133901, "2030/01/01 14:59:59", 10201, "クリスティーナ", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/01/31 12:00:00", 6, 1, 301, 0.0, -285.0, 15.5, 1020103, 61, 133801, "2030/01/01 14:59:59", 10201, "ネネカ", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/02/28 12:00:00", 2, 5, 101, 0.0, -285.0, 9.061, 1020201, 61, 134301, "2030/01/01 14:59:59", 10202, "ランファ", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/02/28 12:00:00", 1, 2, 201, 0.0, -285.0, 7.699, 1020202, 61, 134401, "2030/01/01 14:59:59", 10202, "チカ", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/03/31 12:00:00", 1, 2, 101, 0.0, -285.0, 8.595, 1020301, 61, 134601, "2030/01/01 14:59:59", 10203, "アオイ", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/03/31 12:00:00", 1, 2, 201, 0.0, -285.0, 7.758, 1020302, 61, 134501, "2030/01/01 14:59:59", 10203, "クローチェ", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/04/30 12:00:00", 2, 6, 101, 0.0, -285.0, 7.0, 1020401, 61, 132302, "2030/01/01 14:59:59", 10204, "ルイズマリー", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/04/30 12:00:00", 1, 2, 201, 0.0, -285.0, 7.904, 1020402, 61, 132402, "2030/01/01 14:59:59", 10204, "イロハ", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/04/30 12:00:00", 4, 2, 301, 0.0, -285.0, 8.487, 1020403, 61, 132502, "2030/01/01 14:59:59", 10204, "ソノ", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/05/31 12:00:00", 1, 2, 101, 0.0, -285.0, 8.763, 1020502, 61, 134901, "2030/01/01 14:59:59", 10205, "カノン", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/05/31 12:00:00", 1, 3, 201, 0.0, -285.0, 6.417, 1020503, 61, 134801, "2030/01/01 14:59:59", 10205, "ツムギ", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/06/30 12:00:00", 3, 7, 101, 0.0, -285.0, 10.335, 1020601, 61, 135001, "2030/01/01 14:59:59", 10206, "エリス", "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/06/30 12:00:00", 2, 4, 201, 0.0, -285.0, 6.281, 1020602, 61, 135101, "2030/01/01 14:59:59", 10206, "シェフィ", "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/06/30 12:00:00", 1, 2, 301, 0.0, -285.0, 12.244, 1020603, 61, 135201, "2030/01/01 14:59:59", 10206, "プレシア", "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/07/31 12:00:00", 2, 8, 101, 0.0, -285.0, 6.339, 1020701, 61, 135301, "2030/01/01 14:59:59", 10207, "クリア", "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/07/31 12:00:00", 7, 9, 201, 0.0, -285.0, 8.184, 1020702, 61, 135401, "2030/01/01 14:59:59", 10207, "アネモネ", "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/08/31 12:00:00", 9, 2, 101, 0.0, -285.0, 3.906, 1020801, 61, 129101, "2030/01/01 14:59:59", 10208, "アイラ", "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/08/31 12:00:00", 1, 2, 201, 0.0, -285.0, 14.465, 1020802, 61, 129201, "2030/01/01 14:59:59", 10208, "シナツ", "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/08/31 12:00:00", 4, 3, 301, 0.0, -285.0, 8.662, 1020803, 61, 100101, "2030/01/01 14:59:59", 10208, "ヒヨリ", "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/08/31 12:00:00", 1, 3, 401, 0.0, -285.0, 10.915, 1020804, 61, 100301, "2030/01/01 14:59:59", 10208, "レイ", "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/09/30 12:00:00", 1, 7, 101, 0.0, -285.0, 6.042, 1020901, 61, 135802, "2030/01/01 14:59:59", 10209, "ユキノ", "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/09/30 12:00:00", 4, 1, 201, 0.0, -285.0, 9.402, 1020902, 61, 135903, "2030/01/01 14:59:59", 10209, "サツキ", "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/09/30 12:00:00", 8, 1, 301, 0.0, -285.0, 8.16, 1020903, 61, 136902, "2030/01/01 14:59:59", 10209, "ルルィ", "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/10/31 12:00:00", 3, 2, 101, 0.0, -285.0, 5.0, 1021001, 61, 137401, "2030/01/01 14:59:59", 10210, "カスミ", "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/10/31 12:00:00", 4, 1, 201, 0.0, -285.0, 8.12, 1021002, 61, 136001, "2030/01/01 14:59:59", 10210, "アラクネ", "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/10/31 12:00:00", 4, 2, 301, 0.0, -285.0, 6.386, 1021003, 61, 136202, "2030/01/01 14:59:59", 10210, "ナーナ", "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/11/30 12:00:00", 3, 4, 101, 0.0, -285.0, 7.438, 1021101, 61, 136402, "2030/01/01 14:59:59", 10211, "ユイ", "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/11/30 12:00:00", 1, 5, 201, 0.0, -285.0, 8.35, 1021102, 61, 136302, "2030/01/01 14:59:59", 10211, "ミソラ", "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね");
